import React, { useState } from "react";
const App = () => {
  const [count, setCount] = useState(0);
  const increment = () => {
    setCount(count + 1);
  };
  return (
    <div>
      <div> Hello World</div>
      <br />
      <div>Increment</div>
      <br />
      <button onClick={increment}>{count}</button>
    </div>
  );
};

export default App;
